.header {
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100%;
  background: linear-gradient(0deg, rgba(0, 0, 0, 0.15), rgba(0, 0, 0, 0.15)),
              url(/images/img-bgs/bg-1.jpg);
  background-position: center;
  background-size: cover;
  background-repeat: no-repeat;
  box-sizing: border-box;
  overflow: hidden;

  &__container {
    text-align: center;
  }

  &__bg-forms {
    &-1 {
      position: absolute;
      width: 99px;
      height: 78px;
      top: 2%;
      left: -10.5%;
      background-image: url(/images/bg-forms/section_1-svg_1.svg);
      background-position: center;
      background-size: contain;
      background-repeat: no-repeat;

      @media (min-width: 576px) {
        width: 138px;
        height: 194px;
        top: -5.5%;
        left: 68%;
      }
    }

    &-2 {
      position: absolute;
      width: 93px;
      height: 93px;
      left: 82%;
      top: 30%;
      background-image: url(/images/bg-forms/section_1-svg_2.svg);
      background-position: center;
      background-size: contain;
      background-repeat: no-repeat;

      @media (min-width: 576px) {
        left: -50px;
        width: 220px;
        height: 174px;
      }
    }

    &-3 {
      position: absolute;
      width: 86px;
      height: 122px;
      left: -10.5px;
      bottom: 5%;
      background-image: url(/images/bg-forms/section_1-svg_3.svg);
      background-position: center;
      background-size: contain;
      background-repeat: no-repeat;

      @media (min-width: 576px) {
        left: 90.5%;
        bottom: 55px;
        width: 186px;
        height: 186px;
      }
    }
  }

  &__logo-container {
    margin-bottom: 40px;

    @media (min-width: 360px) {
      margin-bottom: 20px;
    }
  }

  &__logo {
    @media (min-width: 360px) {
      max-width: 120px;
      width: 100%;
      height: 30px;
    }
  }

  &__title {
    margin-bottom: 40px;

    @media (min-width: 576px) {
      font-size: 62px;
      line-height: 73px;
    }
  }

  &__button-registration {
    padding: 16px 50px 17px;
    background-color: transparent;
    border: 2px solid #6ceec7;
    border-radius: 5px;
    box-sizing: border-box;
    font-size: 19px;
    font-weight: 500;
    cursor: pointer;
    transition: color 0.3s, background-color 0.3s;

    &:hover {
      color: #000;
      background-color: #6ceec7;
    }

    @media (min-width: 360px) {
      font-size: 16px;
      padding: 15px 117px 14px;
    }
  }
}

.green {
  color: #6ceec7;
}

