.form {
  &__input {
    max-width: 330px;
    width: 100%;
    height: 56px;
    margin-bottom: 30px;
    padding: 0 50px;
    color: #fff;
    background-color: transparent;
    border: 1px solid #fff;
    border-radius: 5px;
    box-sizing: border-box;
    box-shadow: 0px 4px 15px rgba(0, 0, 0, 0.3);
    font-size: 19px;
    outline: none;
    transition: border-color 0.3s;

    @media (min-width: 576px) {
      width: 300px;
    }

    &:focus {
      border-color: #6ceec7;
    }

    &:hover {
      border-color: #6ceec7;
    }

    &-icon {
      position: absolute;
      transform: translate(-1305%, 65%);

      @media (min-width: 576px) {
        transform: translate(-1175%, 65%);
      }
    }
  }

  &__select {
    width: 330px;
    height: 56px;
    color: white;
    padding-left: 46px;
    margin-bottom: 30px;
    background-color: transparent;
    border: 1px solid #fff;
    border-radius: 5px;
    box-sizing: border-box;
    box-shadow: 0px 4px 15px rgba(0, 0, 0, 0.3);
    outline: none;

    @media (min-width: 576px) {
      width: 300px;
      margin-bottom: 0;
    }
  }

  &__button {
    font-size: 19px;
    line-height: 22px;
    text-align: center;
    padding: 16px 128px 17px 129px;
    margin-top: 20px;
    margin-bottom: 60px;
    background: #6ceec7;
    border: 1px solid transparent;
    border-radius: 5px;
    box-sizing: border-box;
    cursor: pointer;
    transition: color 0.3s, background-color 0.3s, border-color 0.3s;

    &:hover {
      border-color: #6ceec7;
      color: #6ceec7;
      background-color: transparent;
    }

    @media (min-width: 576px) {
      padding: 16px 47px 17px;
      transform: translateX(145%);
    }
  }
}

::placeholder {
  color: #fff;
  font-weight: 300;
}

sources.styles/blocks/_checkbox.scss:
.styled-checkbox {
  position: absolute;
  opacity: 0;

  & + label {
    position: relative;
    cursor: pointer;
    padding: 0;
    margin-left: 17px;
    line-height: 56px;
  }

  & + label:before {
    content: '';
    transform: translateX(-55%);
    display: inline-block;
    vertical-align: text-top;
    width: 20px;
    height: 20px;
    background: transparent;
    border: 1px solid #6ceec7;
    border-radius: 3px;
  }

  &:hover + label:before {
    background: #6ceec7;
  }

  &:checked + label:before {
    background: #6ceec7;
  }

  &:disabled + label {
    color: #6ceec7;
    cursor: auto;
  }

  &:checked + label:after {
    content: '';
    position: absolute;
    left: 5px;
    top: 9px;
    background: white;
    width: 2px;
    height: 2px;
    box-shadow:
      2px 0 0 white,
      4px 0 0 white,
      4px -2px 0 white,
      4px -4px 0 white,
      4px -6px 0 white,
      4px -8px 0 white;
    transform: rotate(45deg) translate(250%, 950%);
  }

  &__text {
    color: #e0e0e0;
  }
}

